List-ToDo  app is a smart to-do list tool. It a highly-efficient and easy time management product which applying for working, personal life, study and travelling.
 
Features:
1) Efficiently Recording: recording all the task no matter happened in your study, working, travelling or inspirations;
2) Classified management: multi-tasks classified by tags or file name which easily to pinpoint your plan;
3) Tracking(Gantt chart): to handle all the task easily according to the deadlines and routing management, making sure all the plan running properly.

